    var polygons: [MKPolygon] = [];
    
    
    func generateExteriorPolygons(_ region: NSArray, name: String) -> MKPolygon {
        
        var coordinates:[CLLocationCoordinate2D] = []
        
        let size = region.count
        var position: Int = 0;
        while position < size-1 {
            coordinates.append(CLLocationCoordinate2DMake(region[position] as! Double, region[position+1] as! Double))
            position += 2
        }
        
        let polygon:MKPolygon = MKPolygon(coordinates: &coordinates, count: coordinates.count)
        polygon.title = name
        
        return polygon
        
    }
    
